INSERT INTO `support_doc` VALUES (9,14,NULL,'iOS 用户使用指导','<p><span style=\"font-size: 18px;\"><span style=\"text-align: justify;\">1. 在App Store中搜索&nbsp;</span><span style=\"color: rgb(51, 51, 51);\">LiFi 找到 LiFi客户端 获取应用；</span></span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(51, 51, 51); font-size: 18px;\">2. 打开LiFi客户端 点击【代理】栏 选择 SS并进入添加代理界面；<br/></span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(51, 51, 51); font-family: -apple-system-font, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, sans-serif; font-size: 18px;\">3. 编辑服务器栏内容为您订阅的服务器地址；<br/></span></p><p><span style=\"font-size: 18px;\"><span style=\"background-color: rgb(255, 255, 255); font-size: 18px; color: rgb(51, 51, 51); font-family: -apple-system-font, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, sans-serif;\">4. </span><span style=\"font-size: 18px; color: rgb(51, 51, 51); font-family: -apple-system-font, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, sans-serif;\">编辑端口栏内容为您订阅详情页显示的端口；</span><br/></span></p><p><span style=\"color: rgb(51, 51, 51); font-family: -apple-system-font, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, sans-serif; font-size: 18px;\">5.&nbsp;编辑加密栏内容为您订阅详情页显示的加密方式；<br/></span></p><p><span style=\"font-size: 18px;\">6. 点击右上角完成按钮，系统出现【是否允许LiFI客户端添加VPN设置】的确认框，点击【允许】即配置完毕；<br/></span></p>',' ',10,20,'2017-04-24 01:59:29','2017-04-27 03:48:38'),(11,11,0,'Windows 用户使用指导','<ol class=\" list-paddingleft-2\" style=\"list-style-type: decimal;\"><li><p><span style=\"font-size: 18px;\">在您的订阅详情页面内点击 【客户端下载】按钮；</span></p></li><li><p><span style=\"font-size: 18px;\">在弹出的对话框内点击【Windows 用户客户端下载】按钮；</span></p></li><li><p><span style=\"font-size: 18px;\">稍等片刻，系统会生成包含订阅信息的Shadowsocks客户端下载地址；</span></p></li><li><p><span style=\"font-size: 18px;\">系统生成完毕后会弹出下载确认框，点击【确认下载】按钮，下载客户端到您的本地；</span></p></li><li><p><span style=\"font-size: 18px;\">解压缩下载内容，打开Shadowsocks.exe 即可使用订阅；<br/></span></p></li></ol>',' ',10,2,'2017-04-27 03:17:50','2017-04-27 04:02:42'),(12,12,0,'Mac OS X 用户使用指导','<ol class=\" list-paddingleft-2\" style=\"width: 934.797px; white-space: normal;\"><li><p><span style=\"font-size: 18px;\">在您的订阅详情页面内点击 【客户端下载】按钮；</span></p></li><li><p><span style=\"font-size: 18px;\">在弹出的对话框内点击【Mac OS X 用户客户端下载】按钮；</span></p></li><li><p><span style=\"font-size: 18px;\">稍等片刻，系统会生成包含订阅信息的Shadowsocks-NG客户端下载地址；</span></p></li><li><p><span style=\"font-size: 18px;\">系统生成完毕后会弹出下载确认框，点击【确认下载】按钮，下载客户端到您的本地；</span></p></li><li><p><span style=\"font-size: 18px;\">解压缩下载内容并打开，即可完成使用；</span></p><p><br/></p><p><span style=\"font-size: 18px;\">* 打开App出现提示：【打不开&quot;sub_订阅号_日期_ssng-client.app&quot;，因为它来自身份不明的开发者】的解决办法：</span></p></li><ol class=\" list-paddingleft-2\" style=\"list-style-type: lower-alpha;\"><li><p><span style=\"font-size: 18px;\">点击左上角苹果图标，在弹出菜单栏内点击【系统偏好设置】；</span></p></li><li><p><span style=\"font-size: 18px;\">在系统偏好设置界面点击【安全性和隐私】；</span></p></li><li><p><span style=\"font-size: 18px;\">在安全性和隐私界面【允许从以下位置下载的应用：】处，点击右侧【仍要打开】按钮；</span></p></li><li><p><span style=\"font-size: 18px;\">在弹出的确认框内点击【打开】按钮即完成；<br/></span></p></li></ol></ol><p><br/></p>',' ',10,2,'2017-04-27 03:18:09','2017-04-27 04:02:26'),(13,13,0,'Android 用户使用指导','<p><span style=\"font-size: 18px;\">1. 下载Android shadowsocks客户端APK文件安装到您的手机；</span></p><p><span style=\"font-size: 18px;\">&nbsp; &nbsp; &nbsp;下载地址 &nbsp;</span><img src=\"http://10.211.55.6:6060/view/js/lib/editor/dialogs/attachment/fileTypeImages/icon_txt.gif\"/><a href=\"/view/storage/editorupload/file/20170427/1493235175660044.apk\" title=\"shadowsocks-nightly-4.1.5.apk\" style=\"color: rgb(0, 102, 204); font-size: 18px; text-decoration: underline;\"><span style=\"font-size: 18px;\">shadowsocks-nightly-4.1.5.apk</span></a></p><p><a href=\"/view/storage/editorupload/file/20170427/1493235175660044.apk\" title=\"shadowsocks-nightly-4.1.5.apk\" style=\"font-size: 12px; color: rgb(0, 102, 204);\"></a></p><p><span style=\"font-size: 18px;\">2. 打开App，点击右上角页面+号图标按钮，选择手动设置，进入配置文件设置界面；</span></p><p><span style=\"font-size: 18px;\">3. 编辑服务器输入栏内容为您已订阅的服务器IP;</span></p><p><span style=\"font-size: 18px;\">4. 编辑远程端口输入栏内容为您订阅详情内显示的端口；</span></p><p><span style=\"font-size: 18px;\">5. 编辑密码输入栏内容为您订阅详情内显示的密码；</span></p><p><span style=\"font-size: 18px;\">6. 编辑加密方法选择栏选择您订阅详情内显示的加密方式；</span></p><p><span style=\"font-size: 18px;\">7. 点击右上角勾号图标保存配置即配置完毕；</span></p><p><span style=\"font-size: 18px;\"><strong><br/></strong></span></p><p><br/></p><p><br/></p>',' ',10,10,'2017-04-27 03:18:28','2017-04-27 03:49:34');
/*!40000 ALTER TABLE `support_doc` ENABLE KEYS */;
UNLOCK TABLES;

